import React, { useState } from 'react';
import axios from 'axios';

//'https://jsonplaceholder.typicode.com/todos/1',
const App = () => {
  const [data, setData] = useState(null);
  const onClick = async () => {
    try {
      app.get('/', (requset, response) => {
        response.header('Access-Control-Allow-Origin', '*');
        response.header('Access-Control-Allow-Headers', 'X-Requested-With');
        // 위 두 줄을 추가해주면 CORS 를 허용하게 됩니다.

        response.send({
          corsTest: 'succeed',
        });
        // 테스트 목적으로 response (응답할) 데이터를 정해주었습니다.
      });
      const response = await axios.get(
        decodeURI(
          'http://openapi.data.go.kr/openapi/service/rest/Covid19/getCovid19InfStateJson?serviceKey=MCOPjJc8P6GG3tLEXY0HTl%2FOzFqj%2BiStMV8aQ4FnL25TCt20be%2BpYIH%2FPQNlfUQyUOtMSxOgSoSA%2BS245I9n%2Fg%3D%3D&pageNo=1&numOfRows=10&startCreateDt=20200310&endCreateDt=20200315&_type=json',
        ),
      );
      setData(response.data);
    } catch (e) {
      console.log(e);
    }
  };
  return (
    <div>
      <div>
        <button onClick={onClick}>불러오기</button>
      </div>
      {data && (
        <textarea
          rows={1000}
          value={JSON.stringify(data, null, 2)}
          readOnly={true}
        />
      )}
    </div>
  );
};

export default App;
